import React from 'react';
import { AppBar, Toolbar, Typography, CssBaseline, Drawer, List, ListItem, ListItemText, Container, Grid, Paper } from '@mui/material';
import { makeStyles } from '@mui/styles';

const useStyles = makeStyles((theme) => ({
    appBar: {
        zIndex: theme.zIndex.drawer + 1,
    },
    drawer: {
        width: 240,
        flexShrink: 0,
    },
    drawerPaper: {
        width: 240,
    },
    toolbar: theme.mixins.toolbar,
    content: {
        flexGrow: 1,
        padding: theme.spacing(3),
    },
    paper: {
        padding: theme.spacing(2),
        textAlign: 'center',
        color: theme.palette.text.secondary,
    },
}));

function Dashboard() {
    const classes = useStyles();

    return (
        <div>
            <CssBaseline />
            <AppBar position="fixed" className={classes.appBar}>
                <Toolbar>
                    <Typography variant="h6">Dashboard Admin</Typography>
                </Toolbar>
            </AppBar>
            <Drawer
                className={classes.drawer}
                variant="permanent"
                anchor="left"
                classes={{
                    paper: classes.drawerPaper,
                }}
            >
                <div className={classes.toolbar} />
                <List>
                    <ListItem button>
                        <ListItemText primary="Usuários" />
                    </ListItem>
                    <ListItem button>
                        <ListItemText primary="Configurações" />
                    </ListItem>
                    <ListItem button>
                        <ListItemText primary="Relatórios" />
                    </ListItem>
                </List>
            </Drawer>
            <main className={classes.content}>
                <div className={classes.toolbar} />
                <Container>
                    <Grid container spacing={3}>
                        <Grid item xs={12} md={6}>
                            <Paper className={classes.paper}>
                                <h2>Estatísticas de Usuários</h2>
                                <p>Total de Usuários: 100</p>
                                <p>Usuários Ativos: 75</p>
                            </Paper>
                        </Grid>
                        <Grid item xs={12} md={6}>
                            <Paper className={classes.paper}>
                                <h2>Relatórios Recentes</h2>
                                <p>Relatório 1: Concluído</p>
                                <p>Relatório 2: Pendente</p>
                            </Paper>
                        </Grid>
                    </Grid>
                </Container>
            </main>
        </div>
    );
}

export default Dashboard;
